SELECT state_code
FROM airport
WHERE airport_name = 'Orlando International Airport';

SELECT a.aircraft_code,
       (a.range_miles::numeric / a.pay_load) AS range_to_payload_ratio
FROM aircraft a;

SELECT aircraft_code,
       (capacity::float / range_miles) AS capacity_to_range_ratio
FROM aircraft;

SELECT state_name
FROM state
WHERE population < 100000;

SELECT state_name,
       (population::numeric / area) AS population_density
FROM state;

SELECT name
FROM restaurant
WHERE food_type = 'Italian';

SELECT (COUNT(*) FILTER (
                         WHERE rating > 4.5) / COUNT(*)) AS high_rating_ratio
FROM restaurant;

SELECT journalname
FROM journal
ORDER BY LENGTH(journalname) ASC;

SELECT name
FROM business
ORDER BY name ASC;
